INSERT INTO `message` VALUES (9, '关于2020年四川师范大学教育基金“本科教学优秀奖”评审结果的公示', '<p>为进一步弘扬尊师重教的优秀传统，营造积极向上的育人氛围，激励教师热爱教学、研究教学、创新教学，潜心教书育人，全面提高本科课堂教学质量，根据《四川师范大学关于开展2020年教育基金&ldquo;本科教学优秀奖&rdquo;评选工作的通知》要求，开展了本年度本科教学评审工作，评审分两个阶段进行。</p>\n<p><strong>第一阶段-院级推优（11月27日前）：</strong>各学院按本年度授课教师总数的1.5%，根据评审条件组织院内评选和推荐，经公示无异议后，推荐参与学校&ldquo;本科教学优秀奖&rdquo;评选人员。</p>\n<p><strong>第二阶段-学校评选（12月6日前）</strong>：学校组成由校内督导和校外专家构成的评审小组，从教学基本情况、教师教学创新、教学研究与成果、课堂教学实录等方面，通过课堂实录视频校外专家独立评价打分和现场答辩评分结合的方式，对参与评优教师的本科教学进行综合评审。</p>\n<p>通过专家评审，根据参评教师的得分从高到低，评选出一等奖2名、二等奖4名、三等奖10名、优秀奖12名，予以公示（名单附后）。</p>\n<p>公示时间为12月8日--12月15日，如对本公示有异议，请于2020年12月15日前向教务处实名反映。</p>\n<p>地址：四川师范大学狮子山校区第二办公区233室</p>\n<p>联系电话：028-84760726</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>四川师范大学教务处</p>\n<p>&nbsp;四川师范大学教师教学发展中心</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2020年12月8日</p>\n<p>&nbsp;</p>\n<p>附件：</p>\n<p><strong>2020</strong><strong>年四川师范大学教育基金&ldquo;本科教学优秀奖&rdquo;拟授奖名单</strong></p>\n<p>（拟授奖项以姓氏拼音排序）</p>\n<table width=\"390\">\n<tbody>\n<tr>\n<td width=\"159\">\n<p><strong>学&nbsp; 院</strong></p>\n</td>\n<td width=\"105\">\n<p><strong>教师姓名</strong></p>\n</td>\n<td width=\"127\">\n<p><strong>拟授奖</strong></p>\n</td>\n</tr>\n<tr>\n<td width=\"159\">\n<p>物理与电子工程学院</p>\n</td>\n<td width=\"105\">\n<p>尚庆红</p>\n</td>\n<td width=\"127\">\n<p>一等奖</p>\n</td>\n</tr>\n<tr>\n<td width=\"159\">\n<p>外国语学院</p>\n</td>\n<td width=\"105\">\n<p>王佳莉</p>\n</td>\n<td width=\"127\">\n<p>一等奖</p>\n</td>\n</tr>\n<tr>\n<td width=\"159\">\n<p>音乐学院</p>\n</td>\n<td width=\"105\">\n<p>黄菊</p>\n</td>\n<td width=\"127\">\n<p>二等奖</p>\n</td>\n</tr>\n<tr>\n<td width=\"159\">\n<p>法学院</p>\n</td>\n<td width=\"105\">\n<p>全亮</p>\n</td>\n<td width=\"127\">\n<p>二等奖</p>\n</td>\n</tr>\n<tr>\n<td width=\"159\">\n<p>外国语学院</p>\n</td>\n<td width=\"105\">\n<p>张静</p>\n</td>\n<td width=\"127\">\n<p>二等奖</p>\n</td>\n</tr>\n<tr>\n<td width=\