>\n<p>数学科学学院</p>\n</td>\n<td width=\"105\">\n<p>唐孝</p>\n</td>\n<td width=\"127\">\n<p>优秀奖</p>\n</td>\n</tr>\n<tr>\n<td width=\"159\">\n<p>国际教育学院</p>\n</td>\n<td width=\"105\">\n<p>王飞华</p>\n</td>\n<td width=\"127\">\n<p>优秀奖</p>\n</td>\n</tr>\n<tr>\n<td width=\"159\">\n<p>历史文化与旅游学院</p>\n</td>\n<td width=\"105\">\n<p>余娟</p>\n</td>\n<td width=\"127\">\n<p>优秀奖</p>\n</td>\n</tr>\n<tr>\n<td width=\"159\">\n<p>体育学院</p>\n</td>\n<td width=\"105\">\n<p>喻雪莲</p>\n</td>\n<td width=\"127\">\n<p>优秀奖</p>\n</td>\n</tr>\n<tr>\n<td width=\"159\">\n<p>生命科学学院</p>\n</td>\n<td width=\"105\">\n<p>张小勇</p>\n</td>\n<td width=\"127\">\n<p>优秀奖</p>\n</td>\n</tr>\n<tr>\n<td width=\"159\">\n<p>文学院</p>\n</td>\n<td width=\"105\">\n<p>赵建明</p>\n</td>\n<td width=\"127\">\n<p>优秀奖</p>\n</td>\n</tr>\n<tr>\n<td width=\"159\">\n<p>心理学院</p>\n</td>\n<td width=\"105\">\n<p>周升群</p>\n</td>\n<td width=\"127\">\n<p>优秀奖</p>\n</td>\n</tr>\n<tr>\n<td width=\"159\">\n<p>美术学院&middot;书法学院</p>\n</td>\n<td width=\"105\">\n<p>朱晓敏</p>\n</td>\n<td width=\"127\">\n<p>优秀奖</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>&nbsp;</p>');
INSERT INTO `message` VALUES (10, '关于2020年下半年中小学教师资格考试（面试）报名相关事项的通知', '<p>各相关教学单位：</p>\n<p>根据四川省教育考试院《2020年下半年中小学教师资格考试四川省面试报名公告》的相关要求，为做好我校学生2020年下半年中小学教师资格考试（面试）报名工作，现将有关事项通知如下：</p>\n<p>一、面试时间</p>\n<p>2021年1月9日至10日，具体时间以准考证为准。</p>\n<p>二、报考范围</p>\n<p>教师资格考试笔试合格，且成绩在有效期内的我校在校学生。参加2020年下半年中小学教师资格考试（笔试）的考生可于12月10日自行登录中小学教师资格考试网站查询笔试成绩。</p>\n<p>三、报考流程</p>\n<p><strong>（一）网上报名：</strong></p>\n<p>1.报名时间：2020年12月10日9:00至12月12日17:00。</p>\n<p>2.报名步骤：</p>\n<p>第一步：登录。登录教育部中小学教师资格考试网站（<a href=\"http://ntce.neea.edu.cn/\">http://ntce.neea.edu.cn</a>）。</p>\n<p>第二步：注册。已参加2020年下半年中小学教师资格考试（笔试）的考生不用注册，其他考生须重新注册。注册时考生须正确填写姓名、证件号码等相关信息，并上传符合要求的电子照片。</p>\n<p>照片要求：(1)本人近6个月以内的<strong>免冠、正面、彩色、白底证件照</strong>，照片中显示考生头部和肩的上部，不允许戴帽子、头巾、发带、墨镜；(2)照片文件不大于200kb，格式为jpg/jpeg; (3)照片将用于准考证及考试合格证明，请考生严格按照要求上传。考生如上传非证件照，将不能通过审核。</p>\n<p>第三步：报名。我校学生统一选择&ldquo;成都考区&rdquo;，并报考对应的面试科目。</p>\n<p><strong>（二）现场审核:</strong></p>\n<p>报名参加面试的我校在读学生按以下时间地点进行现场确认：</p>\n<p>1.时间：<strong>2020年12月12日14:00-19:00。</strong></p>\n<p>2.地点：狮子山校区第二办公区227室。</p>\n<p>3.所需材料：</p>\n<p>参加现场确认的在读学生需提供以下材料：</p>\n<p>①考生本人的居民身份证原件和复印件；</p>\n<p>②港澳台在校生需提供本人的港澳台居民居住证、港澳居民来往内地通行证或五年有效期台湾居民来往大陆通行证原件和复印件；</p>\n<p>③考生本人学生证原件和复印件（学生证遗失则提供学籍证明）。</p>\n<p>4.疫情防控常态下考生参加现场确认时，须按照防疫防控要求做好体温自测，配合学校做好疫情防控检查，在排队等候期间全程佩戴口罩。</p>\n<p><strong>（三）网上缴费：</strong></p>\n<p>考生通过现场审核确认后，即可进行网上缴费。根据川发改价格〔2017〕467号文件精神，面试报考费为每生280元。缴费截止时间为：2020年12月16日24:00。<strong>逾期未在网上缴纳考试费的考生视为自动放弃报名。</strong></p>\n<p><strong>（四）准考证打印：</strong></p>\n<p>考生可于2021年1月4日至1月10日登录中小学教师资格考试网站自行下载、打印面试准考证（建议考生提前1-2天打印并妥善保管），并按准考证上的要求到指定地点参加考试。</p>\n<p>四、面试过程</p>\n<p>1、候考。考生应按准考证上的时间，提前15分钟到达指定地点等候考试。</p>\n<p>2、抽题。考点工作人员登录面试测评系统，从题库中随机抽取试题（幼儿园类别考生从抽取的2道试题中任选1道，其余类别只抽取1道试题），考生确认后，工作人员打印试题清单。</p>\n<p>3、备课。考生持试题清单、备课纸进入备课室，撰写教案（或活动演示方案）。时间20分钟。</p>\n<p>4、回答规定问题。考生由工作人员引导进入指定面试室。考官从试题库中随机抽取2道规定问题，要求考生回答。时间5分钟左右。</p>\n<p>5、试讲或演示。考生按准备的教案（或活动演示方案）进行试讲（或演示）。时间10分钟。</p>\n<p>6、答辩。考官围绕考生试讲（或演示）内容进行提问，考生答辩。时间5分钟左右。</p>\n<p>7、评分。考官依据评分标准对考生面试表现进行综合评分。</p>\n<p>五、其他注意事项</p>\n<p>1.学生必须本人通过教师资格考试网上报名系统进行报名，并对本人所填报的个人信息和报考信息的真实性、准确性负责。</p>\n<p>2.已参加2020年下半年中小学教师资格考试（笔试）的考生无需注册，直接使用笔试报名时注册的账户密码登录。其他考生须在面试报名前重新进行注册。注册时考生须正确填写姓名、证件号码等相关信息，并上传符合要求的电子照片。</p>\n<p>3.四川省面试考生现场确认时间为2020年12月13日-12月15日（9:00-17:00），届时我校将面向成都市所有考生开展现场确认。为方便我校考生，减少排队等候时间，学校安排12月12日下午专门针对我校学生提供现场确认服务。未能在12月12日下午到场确认的我校学生，可在12月13日至15日期间进行确认。<strong>由于成都考区考位有限，达到上限后将关闭考区，届时未参加现场确认的考生可能被分配到其它考区参加面试。</strong></p>\n<p>4.鉴于面试考场编排方案将由四川省教育考试院视各科目报名的具体情况确定，因此可能出现我校考生跨学校参加考试的情况，考生应在打印准考证后仔细核对考试地点，杜绝因走错考试地点导致影响考试的情形发生。</p>\n<p>5.其它未尽事宜，请参见《2020年下半年中小学教师资格考试四川省面试报名公告》，网址：https://www.sceea.cn/Html/202012/Newsdetail_1646.html</p>\n<p>特此通知</p>\n<p>&nbsp;</p>\n<p>四川师范大学教务处</p>\n<p>2020年12月4日</p>\n<p>&nbsp;</p>');
INSERT INTO `message` VALUES (11, '关于组织2020—2021学年度第一学期《大学英语》课程期末考试的通知', '<p>各教学单位：</p>\n<p>按照学校教务处的工作安排，现将本学期《大学英语》课程期末考试的相关工作要求及流程通知如下，请各教学单位协调配合，确保本学期期末《大学英语》课程考试工作顺利进行。</p>\n<p>一、考试时间</p>\n<p>&nbsp;&nbsp;2020级《大学英语》课程期末考试时间：<strong>1月4日下午14：00-16：00；</strong></p>\n<p>&nbsp;2019级《大学英语》课程期末考试时间：<strong>考试时间1月5日下午14：00</strong><strong>&mdash;</strong><strong>16</strong><strong>：00；</strong></p>\n<p>&nbsp;2018级《大学英语》课程期末考试时间：<strong>考试时间1月5日下午14：00</strong><strong>&mdash;</strong><strong>16</strong><strong>：00（专升本学生）。</strong></p>\n<p>二、试卷印制、领取</p>\n<p>1、《大学英语》期末考试由外国语学院大学英语教学部命题，由教务处统一制卷；</p>\n<p>2、《大学英语》试卷印制完成后，由印刷厂统一分送至各学院，各学院教务办根据外国语学院大学英语教学部提供的《四川师范大学课程考试试卷印制登记表》负责试卷接收，并在试卷交接表签字确认。各学院要妥善保管，确保试卷的保密和安全。</p>\n<p>三、考试的组织与管理</p>\n<p>1、大学英语教学部负责本次期末考试的考务工作。</p>\n<p>2、大学英语教学部制作监考安排表及监考须知等考务文件，各学院根据大学英语教学部制定的监考安排表安排落实监考人员。</p>\n<p>3、各学院应按照监考安排表负责发放本学院的相关场次的《大学英语》考试试卷，并提前通知监考安排表上各考场的第一位监考教师到相应考务点领取监考须知、学生签到表、空白试卷袋、小刀、座签、胶水等考务用品，第二位监考教师提前到所在学院教务办领取试卷。第三、四位监考教师按规定时间直接到达考场。</p>\n<p>4、监考教师根据监考须知要求布置考场，学生凭有效证件（学生证、一卡通、身份证等）入场，监考教师须认真核对，并根据考生签到表确认确系本考场考生。</p>\n<p>5、考试结束后，各考场监考老师负责将考试试卷及考务用品交回考务点，在现场完成试卷清点、核对、封装后签字确认。试卷由大学英语教学部负责统一组织评阅并完成相关后续工作。</p>\n<p>&nbsp;</p>\n<p>特此通知</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp;教务处<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2020年11月26日</p>\n<p>附件一、20211《大学英语》期末考试考场安排信息汇总表。</p>\n<p>附件二、20211《大学英语》期末考试试卷接收表（各学院）</p>\n<p>附件三、20211《大学英语》期末考试监考安排表</p>\n<p>附件四、 20211《大学英语》期末考试监考须知</p>\n<p>&nbsp;</p>');
INSERT INTO `message` VALUES (12, '四川师范大学关于2020-2021学年度第二学期教材选用结果的公示', '<p>校内各单位及师生：</p>\n<p>根据我校《关于做好2020-2021学年度第二学期教学用书选用及实验（实训）报告用纸印制填报工作的通知》，学校组织开展&nbsp;了2020-2021学年度第二学期教材选用工作。经任课教师申报、基层教学组织审定、学院党委集体审核等程序，各学院于2020年12月3日前完成了拟选用教材并填写提交了教材选用审核计划表。</p>\n<p>现予以公示，公示时间为2020年12月15日-12月18日，三个工作日。若对教材选用结果有异议，请于在公示期间以真实姓名向教务处反映。</p>\n<p>教务处联系电话:84760726、84480726</p>\n<p>&nbsp;特此公示</p>\n<p>附件:四川师范大学2020-2021学年度第二学期教材选用审核计划表</p>\n<p>&nbsp; &nbsp; &nbsp;</p>\n<p>四川师范大学教务处</p>\n<p>2020年12月14日&nbsp;</p>\n<p>&nbsp;</p>\n<p><br />附件：<br /><a href=\"http://202.115.196.10/uploads/tmp/2020-12/cmsoa1607997693802395.xls\">附件：四川师范大学2020-2021学年度第二学期教材选用审核计划表.xls</a></p>');
INSERT INTO `message` VALUES (13, '四川师范大学关于加强新冠肺炎疫情防控工作的紧急通知', '<p>校内各单位：</p>\n<p>近日，成都市新增新型冠状病毒感染肺炎本地病例。为贯彻落实12月8日省委应对新冠肺炎疫情工作领导小组会议精神、省教育厅《关于加强今冬明春校园疫情防控工作的通知》精神、学校疫情防控工作领导小组2020年冬季疫情防控工作布置会精神，按照属地疫情防控部门的要求，毫不放松地抓好学校的疫情防控工作，维护正常的教学生活秩序，现将有关事项通知如下。</p>\n<p>一、深刻认识校园疫情防控的严峻性和艰巨性</p>\n<p>当前，新冠肺炎疫情在全球加速蔓延，国内一些地方出现零星散发病例，&ldquo;外防输入、内防反弹&rdquo;形势严峻、任务艰巨。校园发生局部聚集性疫情风险加大。校内各单位必须坚持底线思维，把疫情防控作为当前最重要、最紧迫的任务来抓，持续保持高度警惕，坚决克服麻痹思想，坚决打赢疫情防控&ldquo;校园保卫战&rdquo;。必须坚持科学防疫，按照学校联防联控机制，及时应对，采取果断措施防范疫情风险，科学精准做好校园疫情防控工作。必须全面压紧压实防控责任，强化防控措施落实，争分夺秒、全力以赴，坚决防止疫情向校园传播，统筹推进常态化疫情防控和学校事业发展。</p>\n<p>二、根据疫情形势做好信息排查、建立信息台账</p>\n<p>校内各单位必须密切关注疫情动态，严格按照要求，全面排查具有官方发布重点区域旅居史的所有在校师生员工及家属、校内培训班学员、校内商家、在建工程施工人员等。排查结果应及时上报学校疫情防控领导小组办公室（后勤管理服务中心），并落实核酸检测和隔离措施。</p>\n<p>人事处（党委教师工作部）负责教工信息排查汇总报送工作；离退休处负责离退休教工信息排查汇总报送工作；学生工作部（处）&middot;武装部负责本科生信息排查汇总报送工作；研究生院（研究生工作部）负责研究生信息排查汇总报送工作；保卫处、后勤服务管理中心、规划建设处、教育发展集团有限公司负责各自管理范围内有关人员信息排查汇总报送工作；四川省高校干部（师资）培训中心、继续教育学院及相关学院负责培训学员信息排查汇总报送工作。</p>\n<p>学校疫情防控领导小组办公室（后勤管理服务中心）负责汇总各单位报送的防疫信息，学校党政办公室负责向上级主管部门报送信息，学校总值班室（保卫处）负责报送零报告日报告信息，党委宣传部负责对媒体发布信息。</p>\n<p>三、启动校园疫情防控联防联控机制和校内师生员工日报平安机制</p>\n<p>从12月9日起，启动校园疫情防控联防联控机制，每天下午5点，校园疫情防控指挥部组织有关单位主要负责人在学校总值班室进行信息研判和信息处置。从12月9日起，利用掌上川师报平安系统继续开展师生员工健康信息和行动轨迹日报，每日检测体温。由信息排查牵头部门负责此类信息的统计汇总和上报工作。如有异常，立即向学校疫情防控领导小组办公室（后勤服务管理中心）报告。</p>\n<p>四、继续执行校内信息零报告日报告制度</p>\n<p>从12月9日起，校内各单位执行信息零报告、日报告制度，于当日下午4点前，向学校疫情防控领导小组办公室（后勤服务管理中心，电话：84767850）报告。如有异常，随时报告。</p>\n<p>五、进一步加强校园秩序管理，严把校门关</p>\n<p>继续实行校园封闭管理，师生凭证出入、亮码测温通行；确需进校对接工作、考试培训和开展其他临时性工作的，由各主管部门向保卫处申报专职联络人，由专职联络人向保卫处进行工作预约，经身份审核和防疫审核后，亮码测温登记通行；校外一切无关人员（含车辆）禁止进入校园。</p>\n<p>坚持&ldquo;非必要不举办&rdquo;原则，暂停校内一般聚集性活动。确需开展的校内重要培训、招聘、考试、会议等工作，须经学校同意后，将工作方案和防疫方案、校外人员信息等资料报学校疫情防控办公室审核，并在保卫处备案后进行，工作期间严格按照要求进行疫情防控过程管理。</p>\n<p>师生员工应尽量避免外出至中、高风险地区，尽量不参加聚集性活动。</p>\n<p>教育发展集团有限公司要加强对附属学校的防疫要求，各附属学校务必按照属地疫情防控要求做好各项工作。狮子山校区内的附属小学，要严格执行凭证接送学生。教育发展集团有限公司要加强校园快递服务中心的管理，做好快递消毒工作，尤其要对来自中高风险区和境外的快递包裹进行严格消毒，确保快递包裹安全。</p>\n<p>六、加强课堂教学秩序管理</p>\n<p>教务处、学生工作部（处）&middot;武装部、研究生院（研究生工作部）及各学院要加强课堂教学秩序的管理，严格执行课堂考勤制度、请假销假制度、因病缺勤病因追踪登记制度、返岗复课证明查验制度。对无故缺席的学生做好信息登记和信息报送工作，并严格按照学校相关管理规定严肃处理。</p>\n<p>七、加强师生员工的防疫意识和健康教育</p>\n<p>教育引导师生员工增强防疫意识和健康意识，保持良好的生活习惯，坚持体育锻炼，注意冬季季节性疾病防范，做好戴口罩、勤洗手、不聚集、保持社交距离等防控措施。师生员工如有发热或咳嗽等上呼吸道症状，应及时到医院就医，按照学校疫情防控要求进行处置。</p>\n<p>八、做好校园环境卫生消杀消毒工作</p>\n<p>后勤服务管理中心要加强校园环境清扫，定期集中开展校园环境消杀消毒，特别要加强食堂、宿舍、教学楼、实验室、图书馆等人员密集场所的通风和环境卫生。</p>\n<p>九、做好校园就餐秩序管理和食品卫生防疫管理</p>\n<p>各学生食堂实行人员单向流动，进入食堂进行手部消毒，除就餐外全程佩戴口罩，食堂内就餐实行一人一桌，同向就坐，就餐时避免交流，实行错峰分散就餐。各学生食堂在原供餐时间基础上前后延长半小时，即早餐06：30&mdash;09:30，午餐10:30&mdash;13:30，晚餐16:30&mdash;19:30。优化云餐厅服务，网上点餐，快速取餐。倡导自带餐具和打餐后回寝室就餐。各食堂服务人员全程佩戴口罩。</p>\n<p>食材采购、食品加工、食品留样等环节必须严格执行食品卫生有关规定。重点持续抓好冷链食品物防工作。</p>\n<p>国有资产管理处、教育发展集团有限公司要做好校内商家的食品安全教育，坚决禁止无证经营、超范围经营，对其经营的商品和售卖的食品必须可追溯源头，切实防止发生食品安全事故。</p>\n<p>十、加强应急条件保障工作</p>\n<p>按照地方疫情防控要求做好隔离点的准备工作，后勤管理服务中心负责隔离点的环境卫生、值班值守、人员转运、就餐服务等工作；各学院负责对被隔离师生的人文关怀和心理疏导工作；后勤管理服务中心、计划财务处、国有资产管理处要做好防疫物资的采购和准备工作；校医院要做好与地方防疫部门的信息对接工作，指派专人开展发热门诊初诊、协调核酸检测工作和人员转运工作。</p>\n<p>十一、组织好期末教学、期终考试，妥善安排寒假放假和春季开学工作</p>\n<p>统筹常态化疫情防控和教学科研工作，科学安排期末教学和考试，及早谋划寒假放假和春季开学。坚持错峰原则，安排学生分批有序放假离校。妥善安排好留校学生的学习生活。</p>\n<p>十二、做好国际留学生和港澳台学生以及外籍教师的疫情防控工作</p>\n<p>国际交流合作处、国际教育学院负责国际留学生、港澳台学生和外籍教师的疫情防控工作。做到信息掌握精准，防止输入风险。提供必要的防疫物资和必要的生活帮助。</p>\n<p>十三、进一步坚守防疫底线，落实防控责任</p>\n<p>校内各单位党政主要负责人是疫情防控第一责任人，要坚决克服麻痹思想、厌战情绪、侥幸心理和松劲心态，抓紧抓实抓细当前疫情防控工作，坚决守住疫情防控底线。广大师生员工要自觉遵守学校疫情防控要求，如实申报个人健康信息、个人出行信息，服从学校的防疫管理。对疫情防控职责落实不到位、管理流程存在重大漏洞、造成不良后果的情况，严肃追究责任。</p>\n<p>学校将根据疫情发展情况，实时发布疫情防控要求，调整防控措施，请师生员工给予支持和配合。</p>\n<p>特此通知。</p>\n<p>&nbsp;</p>\n<p>四川师范大学</p>\n<p>2020年12月9日</p>\n<p>&nbsp;</p>');
INSERT INTO `paynotice` VALUES (8, '关于2020级全日制本科、研究生登记银行卡号的通知', '<p><strong>各位同学</strong>：</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;为做好2020学年学生各类奖助学金、结算款发放工作，即日起，2020级全日制本科、研究生可登陆&ldquo;四川师范大学财务综合平台&rdquo;进行个人银行账号登记，在校期间的各类奖助学金及结算款均通过银行转储的方式发放至学生本人登记的银行卡。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;在登记银行卡号前请仔细阅读流程内的注意事项，登陆方式及流程见附件。</p>\n<p><strong>&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;</strong><strong>注意：港澳台学生由于情况较为特殊，请各学院辅导员老师收集汇总后提交与计财处姜哲韬老师处（收集信息模板：学号、姓名、银行名称、银行卡号、开户行信息）</strong></p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;咨询电话：84760305。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;特此通知。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;附件：四川师范大学学生银行卡登记或更改操作流程</p>\n<p>&nbsp;</p>\n<p>四川师范大学计划财务处</p>\n<p>2020年10月26日</p>\n<p><br />附件：<br /><a href=\"http://202.115.196.10/uploads/tmp/2020-10/cmsoa1603681749273433.docx\">四川师范大学学生登记更改银行卡账号流程1026.docx</a></p>');
INSERT INTO `paynotice` VALUES (9, '关于计财处系统暂停访问查询服务的通知', '<p>各位老师：</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp; 因计财处系统需要进行安全加固升级，访问查询服务将于2020年12月11日星期五17:30暂停关闭，于2020年12月13日星期日9:00恢复。由此给大家带来的不便，敬请谅解！</p>\n<p>特此通知。</p>\n<p>计划财务处</p>\n<p>2020年12月9日</p>\n<p>&nbsp;</p>');
INSERT INTO `paynotice` VALUES (10, '关于调整我校银行账户信息的通知', '<p>校内各单位、各位师生员工：</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 根据中国人民银行有关银行账户管理办法规定，按照省财政厅要求,为进一步规范管理我校银行账户管理，自2020年12月起，我校正式启用工商银行账户4402217009095018259（零余额账户），统一作为学校对外对内的各类收入和支出的银行基本账户。原有的工商银行账户（4402217009008801123）已变更为非税收入汇缴专户性质，并作为学校其他资金管理账户。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 具体银行账户信息：</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 单位名称：四川师范大学。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 开户行名称：工商银行成都四川师范大学支行。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 账号：4402217009095018259。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 联行号：102651000751。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 银行咨询电话：028-84760313。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 请校内各单位、各位师生员工相互转告，届时在学校网页、计划财务处网页、微信公众号等予以公告。在此之前已经公布的原1123银行账户不影响使用。由此带来的不便，请理解和支持。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 特此通知。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 计划财务处</p>\n<p>2020年12月7日</p>\n<p>&nbsp;</p>');
INSERT INTO `reportnotice` VALUES (24, '关于2020-2021学年第一学期2020级新生领取教材工作的通知', '<p>各教学单位：</p>\n<p>按照教学工作的统一安排，我校2020年秋季2020级学生教材集中发放工作将于2020年8月29日至30日进行，为确保此项工作的顺利开展，现将有关事项通知如下：</p>\n<p><strong>一、领取时间</strong></p>\n<p><strong>1.</strong><strong>狮子山校区：</strong></p>\n<p>8月29日上午&nbsp; 08:15&mdash;10:15&nbsp;&nbsp;数学科学学院 &nbsp;商学院</p>\n<p>8月29日上午&nbsp; 10:15&mdash;11:15&nbsp;&nbsp;教育科学学院</p>\n<p>8月29日上午&nbsp; 11:15&mdash;11:45&nbsp;&nbsp;国际教育学院</p>\n<p>8月29日下午&nbsp; 14:15&mdash;16:15&nbsp;&nbsp;化学与材料科学学院</p>\n<p>8月29日下午&nbsp; 16:15&mdash;17:45&nbsp;&nbsp;文学院</p>\n<p>8月30日上午&nbsp; 08:15&mdash;10:45&nbsp;&nbsp;影视与传媒学院</p>\n<p>8月30日上午&nbsp; 10:45&mdash;11:45&nbsp;&nbsp;历史文化与旅游学院</p>\n<p>8月30日下午&nbsp; 14:15&mdash;14:45&nbsp;&nbsp;心理学院</p>\n<p>8月30日下午&nbsp; 14:45&mdash;15:45&nbsp;&nbsp;法学院</p>\n<p>8月30日下午&nbsp; 15:45&mdash;17:45&nbsp;&nbsp;马克思主义学院</p>\n<p><strong>2.</strong><strong>成龙校区：</strong></p>\n<p>8月29日上午&nbsp;08:15&mdash;09:30&nbsp;外国语学院</p>\n<p>8月29日上午&nbsp;09:30&mdash;10:30&nbsp;音乐学院</p>\n<p>8月29日上午&nbsp;10:30&mdash;11:30&nbsp;商学院</p>\n<p>8月29日上午&nbsp;11:30&mdash;12:30&nbsp;服装与设计艺术学院</p>\n<p>8月29日下午&nbsp;14:15&mdash;15:30&nbsp;计算机科学学院</p>\n<p>8月29日下午&nbsp;15:30&mdash;16:30&nbsp;美术学院</p>\n<p>8月29日下午&nbsp;16:30&mdash;17:45&nbsp;经济与管理学院</p>\n<p>8月30日上午08:15&mdash;09:30&nbsp;舞蹈学院</p>\n<p>8月30日上午&nbsp;09:30&mdash;10:30&nbsp;地理与资源科学学院</p>\n<p>8月30日上午&nbsp;10:30&mdash;11:45&nbsp;生命科学学院</p>\n<p>8月30日下午&nbsp;14:15&mdash;15:30&nbsp;体育学院</p>\n<p>8月30日下午&nbsp;15:30&mdash;16:30&nbsp;物理与电子工程学院</p>\n<p>8月30日下午&nbsp;16:30&mdash;17:45&nbsp;工学院</p>\n<p><strong>二、领取地点</strong></p>\n<p>1.狮子山校区学生：在狮子山校区第二教学楼教材中心书库领取</p>\n<p>2.成龙校区学生：在成龙校区第一教学楼B区书库领取</p>\n<p><strong>三、注意事项</strong></p>\n<p>1.请各学院教学班学习委员或班长严格按照时间安排到相应校区书库领取教材，领取的同学应认真核对班级学生人数，严格按照教材出库单上的教材种类核对教材名称、作者、价格及数量等相关信息，务必当面点清，确保准确无误；</p>\n<p>2.在按照教材出库单进行班级同学教材分发时，如发现因核对学生名单和统计人数失误而领取了休学、退学或其它原因不在本班的同学的教材，请及时退回多领的教材，否则费用由本班承担；</p>\n<p>3.请通知每一位同学,领到教材后暂时不要写字，并注意不要污损，待正式上课时与老师确认教材无误后，再写名字，未写字和未污损的教材，如领取有误可以在领取之后的五个工作日内到领取书库退换，否则不予退换。</p>\n<p>&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;特此通知</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>四川师范大学教务处</p>\n<p>2020年8月21日</p>\n<p>&nbsp;</p>');
INSERT INTO `reportnotice` VALUES (25, '关于新生报到期间实施交通管制的通告', '<p>按照学校工作安排，2020级新生将于9月19日来校报到。为确保新生报到期间校园交通顺畅及正常秩序，现将新生报到期间校园及周边交通管制事项通告如下：</p>\n<p>一、管制时间</p>\n<p>9月19日0∶00&mdash;18∶00</p>\n<p>二、交通管制措施</p>\n<p>1.狮子山校区北大门、小北门禁止机动车辆通行，教职员工车辆请从南大门、东大门出入。</p>\n<p>2.封闭狮子山校区北大门至附属实验学校转盘沿线路段及生态广场北侧路段。</p>\n<p>三、其它事项</p>\n<p>1.按疫情防控要求，师生员工及校内车辆凭证进入校园；校外无关人员和车辆不允许进入校园。</p>\n<p>2.请学校教职员工在上述时段尽量不以自驾车辆为代步工具，对于不得不驾车进入校园的车辆不得堵塞各类应急通道且须听从安保人员指挥，有序停放。</p>\n<p>四、送新生报到车辆的停放地点</p>\n<p>经与属地交管部门协调，送新生报到车辆的停放地点如下：</p>\n<p>狮子山校区：校区周边的菱窠路、菱安路、东大门外中环大道沿线。</p>\n<p>成龙校区：东坡门外车城大道沿线。</p>\n<p>需在校园周边停车的应遵守临时占道停车的有关规定，自觉维护道路顺畅及校园周边应有的秩序。</p>\n<p>特此通告。</p>\n<p>&nbsp;</p>\n<p>保卫处</p>\n<p>2020年9月17日</p>\n<p>&nbsp;</p>');
INSERT INTO `reportnotice` VALUES (26, '关于做好2020级新生开课计划填报工作的通知', '<p>各有关教学单位：</p>\n<p>为保证2020级新生报到后教学工作的顺利开展，现将有关事宜通知如下：</p>\n<p><strong>一、生成2020级各专业教学计划</strong></p>\n<p>各教学单位应于9月7日前将本学院2020版人才培养方案录入&ldquo;四川师范大学教务管理系统&rdquo;，并在核对无误后将各专业学生选择对应关联到相关专业的教学计划。</p>\n<p><strong>二、填报开课计划</strong></p>\n<p>各教学单位应于9月11日前严格按照2020级相关专业人才培养方案在&ldquo;四川师范大学教务管理系统&rdquo;中认真填报开课计划，部分需调整新生班级的学院经教务处同意后可适当放宽至9月12日。</p>\n<p>1、本学期2020级的教学周数为14周（不含国庆长假），请各教学单位结合实际情况合理安排课程的周学时。</p>\n<p>2、关于专业课。由各教学单位根据2020级相关专业人才培养方案认真填报，不得擅自更改或随意调整教学计划。</p>\n<p>3、关于公共课。由承担公共课的教学单位严格按照2020级相关专业人才培养方案的具体要求进行填报，填报开课计划时务必对课程的开课学期、周学时等信息进行认真核对，坚决杜绝应开课程遗漏、开错修读专业等现象发生。</p>\n<p>4、关于任课教师。（1）各教学单位务必坚持教授、副教授给本科生授课制度，以及教授、副教授面向低年级学生讲授专业基础课程制度。（2）为进一步加强教师管理和教学工作考核，任课教师一经确定并录入系统后，不得擅自更改，请各教学单位慎重对待。无工资号的新进教师及外聘教师，请及时到人事处提交相关材料备案并获取教师编号。</p>\n<p><strong>三、其它</strong></p>\n<p>各教学单位完成开课计划填报工作后，教务处将及时进行2020级新生课程排课。各教学单位如果对排课有具体要求，请在填报开课计划时一并提交教务处注册中心，便于注册中心排课时统筹安排。</p>\n<p>请各教学单位于2020年9月11日（部分学院可适当放宽至9月12日）前完成所有2020级新生开课计划填报工作，并将一份签字盖章后的纸本开课计划交教务处注册中心备查。</p>\n<p>特此通知。</p>\n<p>四川师范大学教务处</p>\n<p>2020年9月4日</p>\n<p>&nbsp;</p>');
