INSERT INTO `trategy` VALUES (5, '弘扬校训精神 师大学子当自强', '<p>校训是一所学校的灵魂，短短几字，却能反映学校的精神气质。一句振奋人心的校训，能让人激起拼搏的斗志与挑战的勇气；一句文辞隽永的校训，能给人带来平静与安宁，是象牙塔里的一壶清茶；一句脚踏实地的校训，教人既要读懂书本学问，也要钻研做人的学问、生命的学问。</p>\n<p>重德、博学、务实、尚美是四川师范大学的校训，也是我校师生始终践行和弘扬以图自强的精神，今天我也想从这四个角度谈谈川师学子们是如何&ldquo;自强&rdquo;的。</p>\n<p><strong>一、强品德</strong></p>\n<p>重德，即重视思想道德。德为人才素质之首，师生以法律和道德为行为标尺。教师要以好的品德和作风锤炼自我，并育出好品德的人才；学生要以德修身，诚信待人，未来才能革故鼎新，传承文明。要在全校培育形成良好的文明道德风尚，增强学校凝聚力和可持续发展能力。</p>\n<p>学生思想品德上的自强，就是为我国整体国民素质的提高做出贡献。在同各界优秀青年代表座谈时，习近平总书记曾这样说到：&ldquo;广大青年要把正确的道德认知、自觉的道德养成、积极的道德实践紧密结合起来，自觉树立和践行社会主义核心价值观，带头倡导良好社会风气。要加强思想道德修养，自觉弘扬爱国主义、集体主义、社会主义思想，积极倡导社会公德、职业道德、家庭美德。&rdquo;</p>\n<p>从第一天进校开始，大一的新生们便会被要求阅读《学生管理手册》，部分学院也会对内容加以考核。这一要求一方面有助于新生了解学校各项规章制度并遵守，另一方面也有利于新生思想品德方面的建设。此外，我校还在新生中开展了&ldquo;十个一&rdquo;教育养成活动，其中&ldquo;价值引领类&rdquo;活动坚持立德树人、德育为先，包括思想道德和政治素养培养等。这些活动也起到了对学生进行价值引领和思想政治教育的作用，有利于培养新生树立正确的世界观、人生观和价值观。</p>\n<p>在校园内，川师学子&ldquo;重德&rdquo;的表现也随处可见：图书馆里，遵守一人一座规则，不霸座、占位；桃李园里，就餐的同学们排队整齐，几乎很少出现插队现象；操场上，打完球的同学们会把喝完的空瓶一并收走&hellip;&hellip;这些场景无一不体现着川师学子在品德方面对自己的高标准、严要求。</p>\n<p><strong>二、强学识</strong></p>\n<p>博学，即拥有广博的知识。学校在育人理念上，倡导学生要博古通今，文理兼修；教师作为文明的使者，只有具有广博的知识，才能&ldquo;传道授业解惑&rdquo;；学生只有拥有广博的知识，才能成为一个理性的人，成为一个对社会有用的人，才能在未来的激烈竞争中实现自己的人生价值和社会价值。</p>\n<p>知识水平的积累，直接决定着一个国家科研创新能达到的高度。习近平曾在北京大学师生座谈会上这样说过：&ldquo;知识是每个人成才的基石，在学习阶段一定要把基石打深、打牢。学习就必须求真学问，求真理、悟道理、明事理，不能满足于碎片化的信息、快餐化的知识。要通过学习知识，掌握事物发展规律，通晓天下道理，丰富学识，增长见识。&rdquo;</p>\n<p>四川师范大学向来重视对优秀教师的培养，始终坚持&ldquo;解放思想、激活人才、外引内举、注重培养&rdquo;的人才工作理念，大力实施&ldquo;人才强校&rdquo;战略,努力造就一支师德高尚、业务精湛、结构合理、充满活力的高素质教师队伍。</p>\n<p>师者，所以传道授业解惑者也。我校作为四川省规模最大、学科门类最全的综合性省属重点师范院校，每一位学生，都有可能在未来走上三尺讲台，成为人民教师。这就要求学生有着过硬的本领：需要考取教师资格证和普通话证书，需要努力学习专业知识，更需要有着为我国教育事业奉献全部力量的精神。今年9月初，教师资格证报考窗口刚一开放，我校便有2000多名学生报名参加。踊跃报名一方面源于川师学子的自信和对教育事业的热情，另一方面也反映了学生们的知识水平、专业能力在提升，向着新目标、新挑战不断前行。</p>\n<p><strong>三、强实践</strong></p>\n<p>务实，即求真务实，开拓创新，认认真真做人，踏踏实实做事。这是四川师大人人生态度和办学精神的写照。&ldquo;知之为知之，不知为不知，是知也&rdquo;，要有踏实的治学精神和工作作风，要勤于治学，严谨治学。</p>\n<p>在参观复兴之路的展览上，习近平总书记说了这样一句话：&ldquo;空谈误国，实干兴邦&rdquo;，实际上这就是告诉我们，不要去一味地空谈，选拔那些巧言令色的人。很多人他不说话，但是埋头苦干，这些人才是非常值得人珍惜的。</p>\n<p>无独有偶，早在900多年前，陆游便认识到&ldquo;纸上得来终觉浅，绝知此事要躬行&rdquo;的道理。在大学的学习也是如此，光有书本上的知识是不够的，要想学得踏实、实际，就必须要将知识内化于心、外化于行，在实践中检验自己所学知识的正确性。</p>\n<p>四川师范大学是全国深化创新创业教育改革示范高校、国家大学生创新创业训练计划项目实施高校，建设有国家实验教学示范中心、国家大学生校外实践教育基地等系列平台，学生已承担国家级和省级大学生创新创业项目近2000项。在川师，每年都会举办&ldquo;务实杯&rdquo;等一系列的大学生暑期社会实践活动。可以说学校为想要通过实践提升自己的同学们提供了非常好的平台。</p>\n<p>而我们的川师学子对于实践也充满了热情，每年都有上百支队伍、上千名同学投身到社会实践中来，有的会去到成都市内或是周边地区，更多的，则选择了远在各乡镇、县城的学校中，去到这些最需要他们的地方，去支教、援藏，为祖国基层事业的发展尽一份力。这都是我校学生在实践方面奋发图强的体现。</p>\n<p><strong>四、强体魄</strong></p>\n<p>尚美，即要有崇尚美的心灵，要有正确的审美观念和高尚的审美情趣，要把自然美、社会美、艺术美内化为人生修养。</p>\n<p>如果要问什么是美，我相信每个人对美的定义都不尽相同。在笔者看来，美就是有着健康的身体和高尚的灵魂。高尚的灵魂可以通过学习、阅读来获得，而健康的身体则离不开作息规律、饮食正常、勤加锻炼。</p>\n<p>在由体育大国向体育强国迈进的过程中，群众体育的发展必不可少。习近平多次就发展全民健身，推动群众体育、竞技体育和体育产业的协调发展作出指示。他还十分关注青少年健身运动的普及发展，鼓励青少年积极投身体育锻炼。早在2014年看望南京青奥会的中国体育代表团时，习总书记就说过：&ldquo;少年强、青年强则中国强。少年强、青年强是多方面的，既包括思想品德、学习成绩、创新能力、动手能力，也包括身体健康、体魄强壮、体育精神。&rdquo;</p>\n<p>虽然我们是师范学校，但体育从来不是我们的弱项。每天清晨和傍晚，总是可以在操场上看到许多正在锻炼的师生，打篮球、踢足球、跑步，他们用行动响应着国家迈向体育强国的号召，通过投身体育锻炼达到强健体魄的目的。特别是我校的女子篮球队，更是在全国比赛上屡创辉煌，多次名列前茅。</p>\n<p>四川师范大学向来对师生的身体素质发展极为重视，除了每年都有的校运动会以外，还有教职工运动会、&ldquo;雄鹰杯&rdquo;男子篮球赛、&ldquo;巾帼杯&rdquo;女子篮球赛、&ldquo;雄狮杯&rdquo;男子足球赛等丰富的体育活动。此外，两个校区随时开放的运动场、健身房也为师生们提供了强身健体的场所。这些举措都体现了川师对于师生身体素质发展的高度关注。</p>\n<p>《中华百科辞典》对于校训的定义是&ldquo;学校为训育之便利，选若干德育条目制成匾额，选见于校中公见之地&rdquo;，&ldquo;目的在于使个人随时注意而实践之&rdquo;。作为学校的灵魂与标尺，我校校训所蕴含的精神也正被所有师大学子内化于心、外化于行，践行于个人自强不息的奋斗路上、弘扬于民族伟大复兴的征程中！</p>\n<p>&nbsp;</p>');
INSERT INTO `trategy` VALUES (6, '师大校友感恩浓——四川师范大学研究生校友分会致贺母校74华诞', '<p>狮子山拥川师大 ，孔圣雕塑象牙塔 ；厚德博学亦尚美 ，桃李芬芳誉华夏 。母校四川师范大学跨越74载时空岁月，演进为省属重点大学，发展为中西部师范教育高地，凝练形成以&ldquo;重德、博学、务实、尚美&rdquo;为核心的师大校训。回首母校的研学时光，眼前油然再现那如茵春草的画卷，耳边回荡此起彼伏的学术争鸣，脑海沉浸于荷塘月色的漫步深思，品味着恢复高考而研读师大的柳暗花明......这是师大学人难忘的人生坐标记忆。在母校建校74周年的大喜日子里，全体研究生校友感怀老师的敦敦教导，感谢母校的培育深恩！</p>\n<p>今年是母校开展研究生教育41周年，母校研究生教育伴随国家经济社会快速发展步伐，在一代代川师大人励精图治、艰苦奋斗下取得了诸多重要成绩。同时，毕业的一批批硕士、博士研究生校友，在教育领域、科研院所、党政机关、企事业单位等领域致力社会发展、推动人类文明进步。母校对研究生校友重视关爱，2019年10月隆重成立了&ldquo;四川师范大学研究生校友分会&rdquo;，母校领导从时代、使命和责任层面提出要求和希望：时代，即把握中国特色社会主义新时代的契机；使命，即母校发展的两大愿景和四大使命；责任，即坚持&ldquo;学生中心、教师主体、引领社会&rdquo;办学理念，实施&ldquo;五大战略&rdquo;和&ldquo;六大方略&rdquo;。期待通过全校师生和校友共同努力，进一步推动四川师范大学事业发展，创造学校新的辉煌，让母校师生和校友在师大精神家园里享受生命的美好、肩负生命的责任、彰显生命的光辉。</p>\n<p>校友桥通任驰骋，情感同体事业兴；重德博学亦尚美，海纳百川与时进。新时代争创一流大学竞争的日臻激烈，创名校客观上亟需海纳百川推发展。母校以培养优秀学生为天职，把校友珍视为办学质量的一面镜子和一把标尺；学生以在母校研学成长为荣幸，当以反哺母校发展为己任。我们全体研究生及其校友分会，要抓住母校74周年校庆的契机，以母校提出的&ldquo;构筑母校与校友的情感同体和事业共同体&rdquo;的工作要求，寻求情投意合、志同道合、守望相助、共同发展，为母校新时代新的发展跨越做出更大的贡献！</p>\n<p>祝母校蒸蒸日上，祝师生幸福安康！</p>\n<p>&nbsp;</p>\n<p>四川师范大学研究生校友分会</p>\n<p>2020年5月16日</p>\n<p>&nbsp;</p>');
INSERT INTO `trategy` VALUES (7, '晏阳初与四川师大', '<p>2020年10月21日，四川师大举办纪念晏阳初诞辰130周年座谈会。与会专家学者贤达人士，公认晏阳初平民教育思想和乡村建设理论是中华民族的一笔优秀遗产，是中国、是四川、特别是四川师大的一笔宝贵财富。与会者期望四川师大保护好这笔财富，传承和发扬好晏阳初思想。</p>\n<p>各级各界人士在关于宣传晏阳初思想、传承晏阳初精神方面，对四川师大寄于如此厚望，因由何在呢？</p>\n<p>江河朔源，可至极远，直到它最初的一汪泉水，一股清流。记得当年走马川西北高原，寻找到岷江源头，只见一小股泉水汩汩流出，泉水旁立着一块碑，碑上刻着&ldquo;岷江源头&rdquo;几个字。依此理，我们来看看川师大的源头在何处。过去人们常说川师大的源头是川北农工学院以及西山文学院，这是大家所熟知的。但还有好多人们不熟悉不了解的。如原重庆师范专科学校（非现存的重庆师范大学）和中国乡村建设学院（过去常常被忽略）。这诸多源流中，哪一条源流最为久远呢？我们认为应该是中国乡村建设学院（以下简称&ldquo;乡建学院&rdquo;）。</p>\n<p>中国乡村建设学院成立于1940年，晏初阳是首任校长。</p>\n<p>解放初，中国乡村建设学院改名为川东教育学院。后川东教育学院撤销，其教师和学生分别划入四川师范学院和西南师范学院，而乡村建设学院的所有档案资料，则全部归入四川师范学院档案馆。上世纪八十年代和九十年代初，不少乡村建设学院的校友常回川师大查找有关资料和开具学历证明。</p>\n<p>我校原教育系教师庾国琼便是晏阳初的学生，原工会干部牟锡林便是晏阳初身边的工作人员。</p>\n<p>1992年，四川师大举行建校40周年（当时校史起算时间是由川北大学更名为四川师范学院的1952年）庆祝活动，50余名原中国乡村建设学院的校友回到学校。庆祝活动期间，这批校友发起倡议，在四川师大为老校长晏阳初建立塑像。现立于中心花园喷泉左侧的晏阳初座像，便是当年乡建学院校友们的捐赠所为。而同期建立的陶行知半身像，则是当时在校各年级学生受乡建学院老校友的感召自动捐款塑建的。</p>\n<p>说来很有意思，当晏阳初和陶行知的塑像落成后，人们便时常想起当年&ldquo;南陶北晏&rdquo;的美好传说。</p>\n<p>到了2002年，四川师大建校50周年大庆，在晏阳初和陶行知塑像之间校园的主轴线上，塑起了孔老夫子的像。这样，三个教育家立于狮子山校区的核心地带，审视着作为&ldquo;教师摇篮&rdquo;的川师大的发展变化。同时也突显出川师大办学的核心价值和办学特色。</p>\n<p>让我们走近晏阳初和陶行知的身旁。在晏阳初座像的背后，镌刻着他的一句名言：&ldquo;除天下文盲，作世界新民&rdquo;。这是激励着他，鼓舞着他为之奋斗了一生的座右铭。而那位&ldquo;捧着一颗心来，不带半根草去&rdquo;的陶行知塑像的碑体上，则刻着毛泽东的题词&ldquo;伟大的人民教育家陶行知&rdquo;。看出这两位圣人先哲的共同点了吧？他们的胸膛里，装着的尽是人民、平民，农民！我们将人民教育家和平民教育家作为川师大的先辈，当是何等荣光！川师大作为&ldquo;人民教师的摇篮&rdquo;，又该有何等豪迈的历史担当！</p>\n<p>2004年春，晏阳初的学生、当年中国乡建学院地下党支部书记詹易之，率成都乡建学院校友再次回访四川师大。这次他们是专门回校祭拜他们的老校长晏阳初的。但这次回校，他们真的是老了。七八十岁的一群老人在晏阳初塑像前三鞠躬，感动了在场很多人。晏阳初生前，詹易之曾经将中国乡村建设学院归属四川师大的消息告诉过远在美国的他。他听到这一消息后连说：&ldquo;这样很好，这样很好&rdquo;。</p>\n<p>在狮子山校区，我们每天都能见到晏阳初。但真正熟悉和全面了解晏阳初的人并不多。那就让笔者简单地向你作个介绍吧。晏阳初是个世界性的伟大人物。他曾被美国总统里根称赞为&ldquo;人类的颂歌&rdquo;，被非洲朋友呼作&ldquo;农民的父亲&rdquo;。1943年，全美一百余所大学校院长举行纪念哥白尼逝世400周年大会，大会评选出当代最具革命性贡献的十大伟人。晏阳初便是其中之一，亚洲唯一一个，与爱因斯坦、杜威、莱特兄弟俩齐名。在授予他&ldquo;十大伟人&rdquo;称号的表扬状里称他是&ldquo;杰出的发明者&rdquo;，&ldquo;使书本上的知识开放给以前万千不识字的人民，应用科学方法，肥沃他们的田地，增加他们的辛劳果实&rdquo;。晏阳初的平生功劳是平民教育和乡村建设两大贡献。他求读香港，留学美国。他从耶鲁大学毕业的第二天便参加了第一次世界大战。在法国里昂，他在近20万华工中办起了华工识字班，这就成了他后来开展轰轰烈烈的平民教育运动的开端。</p>\n<p>1987年6月，97岁高龄的晏阳初再次回到祖国。在同全国人大副委员长周谷城、朱学范会面时，他说&ldquo;我这次来就是看看在哪些方面，我们对于祖国多多少少可以有点贡献&rdquo;。这年7月5日，在中国革命博物馆会议厅，晏阳初会见了四川师大校长王均能。他仔细询问了四川师大各方面的情况，还问歇马场（中国乡村建设学院旧址）有哪些变化，问当年乡村建设学院修建的那座水电站还在发电没有，等等。晏阳初同王校长谈兴甚浓。他向王校长介绍他当年在湖南衡山创办乡村师范学校的情况。还对王校长说大学搞培训很重要。抗战时期，他受张治忠之邀在湖南训练民众、组织民众，培训了一万名保长领导基层民众抵抗日寇等等。在博物馆金碧辉煌的会议厅里，王均能校长代表学校向晏阳初赠送了一幅对联：&ldquo;寻求有贝之财，培养无贝之才，投身乡村建设，周游全世界；解除苦力之苦，开发苦力之力，从事平民教育，奋斗70年&rdquo;。王校长还将刚刚摄制的全面反映川师大教学科研和师生生活情况的录像带《智泉》赠送晏阳初。王校长邀请晏阳初回川师大看看。当他从王校长手里接过邀请他访问四川师大的请柬时，他紧紧地握着王校长的手说：&ldquo;一定回来，一定回来。请你们把四川师范大学办得越来越好&rdquo;。但晏阳初终究未能回来。&ldquo;请你们把四川师范大学办得越来越好&rdquo;便成了他对四川师大唯一的也是最后的嘱托。</p>\n<p>1990年，元旦刚过，晏阳初因肺炎在美国逝世，享年100岁。1993年，晏阳初魂归故里。四川师大派出代表，同他的学生们和巴中地区代表团一道到重庆迎灵。之后又同巴中各界人士及他的弟子们，护送灵车回巴中并参加安葬仪式。</p>\n<p>为永远铭记晏阳初对人类作出的伟大贡献，传承和弘扬他的精神和思想，1989年，经副省长韩邦彦，省政协副主席章玉钧等人提议，成立&ldquo;四川省晏阳初研究会&rdquo;，作为省社科联团体会员，挂靠四川师范大学，为省一级学会。&ldquo;四川省晏阳初研究会&rdquo;于1989年3月在四川师范大学举行成立大会，王均能校长当选名誉会长，时任党委副书记洪宝书、中文系教授刘君惠当选为顾问，时任副校长杜兴华、教务处长沈庆生当选为副会长，校工会干部牟锡林，教育系教授刘世民当选为副秘书长，庾国琼教授当选为常务理事。</p>\n<p>在四川省晏阳初研究会成立三十余年的岁月里，四川师大的领导和专家学者，一直担任了晏研会的领导职务和参加了其中重要工作。王均能、杨泉明、高林远一直是晏研会的名誉会长，我本人多年担任常务副会长并兼任法人，汪明义、顾美龄多年担任副会长，张海东、唐文焱、涂绪谋、胡尚峰、万英等一直担任副秘书长或参与其中重要工作。后来者龚学文、杜松、冯敏等年青人，紧紧地跟随着晏阳初的研究队伍，不断学习，而今已有初步成果。</p>\n<p>晏阳初是四川师大历史上的一座丰碑。他是高原上的一座高峰，需崇敬、景仰，须代代讴歌。学习、发扬晏阳初，咱们师大人，手中旗不松。</p>\n<p>（作者系我校原副校长、四川省晏阳初研究会常务副会长）</p>\n<p>&nbsp;</p>');
